The development will consist of the following works to the three storey extended dwelling and coach house:
• Removal of part of the single storey extension to the rear;
• Construction of a new two storey extension to the rear and single storey extension to the side and rear;
• Two new windows to south elevation of original house;
• New dormer window to the rear at roof level as well as roof lights within the roof of the two storey and single storey extension;
• Solar panel (3sqm) within south elevation of two storey extension; and
• Refurbishment and internal amendments to the existing three storey dwelling.
• Refurbishment of the coach house to the rear to provide ancillary accommodation to the main house to include removal of two storey extension on the north-east elevation and single storey extension to north-west elevation; and construction of new single storey extensions to north-east and north-west elevations, and the provision of a 4 no. velux windows to south-west elevation of main roof, and roof light above north-west extension;
• All associated landscaping, drainage and site development works at Coolbeg, 14 Shrewsbury Road, Ballsbridge. Dublin 4.

a) Change of use from offices/shop to single family residential use , 
b) Demolition of a part 2 storey rear return and part single storey rear extension garden infill;
c) Alterations of rear and gable external elevations as well as alterations to internal layout;
d) Provision of 2 no. new roof lights;
e) Change of finishes of front and rear windows from PVC to timber finish;
f) Alterations of existing boundary wall;
g) With associated site works, services and landscaping;
All of the above to take place at the site located at 48 Hamilton Street, Dublin 8

SHOPFRONT ALTERATIONS to the front and side elevations comprising:
 
1. Replacement front and side fascias with backlighting and with internally illuminated block lettering for the Terenure Inn; 
2. Illumination of the front and side elevation pilasters for the Terenure Inn utilising concealed lighting; 
3. Removal of the outer entrance doors to create a recessed street entrance for Vermilion Restaurant; 
4. Replacement entrance doorcase with backlighting, applied medallions, built-in and internally illuminated menu boards, decorative reveal panels and a backlit fascia with integral signage for Vermilion Restaurant. 
Permitted or deemed compliant external lighting and window boxes mounted above the shopfront level are unchanged.  Permitted shopfront awnings at the Terenure Inn are unchanged.

PROTECTED STRUCTURE: The development will consist of -
New opening with new timber framed window to front at lower ground floor level;
Removal of non-original door and partition to upper ground floor level;
Alteration of internal layout at lower ground floor level, including removal of sections of original and non-original walls;
Removal of non-original windows and doors and widening of existing opes to rear at lower ground floor level;
New 22sqm single storey extension to rear with roof light and timber screen to rear garden;
Associated conservation works, landscaping works, site works and ancillary works.

PROTECTED STRUCTURE: Development at a site with the overall Grangegorman Strategic Development Zone (SDZ) of approx. 28.69 hectares at Grangegorman , Upper Grangegorman , Dublin 7.  The specific site of the proposed development comprises approx. 0.06 hectares and is located on the western side of Grangegorman Upper bounded by the Female House to the north, Church of Ireland Chapel to the south, the Female Infirmary to the east and the Male Infirmary to the west (all protected structures) at the former St. Brendan’s Hospital.  
The development will consist of the conservation and renovation of the Roman Catholic Chapel (a Protected Structure) of some 299 sq.m (ground floor and first floor) and its adaption to provide for a multi-use campus space at ground floor of approx. 257 sq.m (including religious, education, recreation, performance, rehearsal, events) at ground floor level.  The Chapel will still be used for religious services.  The proposed works comprise the maintenance, conservation and renewal works to the internal and external fabric of the Roman Catholic Chapel to include, repair and replacement works to roof; repair of stained glass; refurbishment/replacement of existing rainwater gutters and downpipes; replacement of loose and damaged ridge tiles and slates, refurbishment and reinforcement of granite coping; replace existing defective lime render to existing walls; 
Permission is also sought for the provision of new French drain to perimeter of building; refurbishment/replacement of the floor structure to nave of church; replacement of existing sanitary ware; re-orientation of door to existing W.C.; provision of new glazed screen and doors to facilitate new meeting room; new double door to form draught lobby, new plasterboard soffit to gallery, new balustrade to gallery; new moveable screen to facilitate multi-use of the space; replacement of mechanical and electrical services and for all associated site development and drainage works.
